import React from 'react';


function Banner() {
  return (
    <div className="Banner col-24 sections" 
    style={{  
        backgroundImage: "url(" + "https://thereceptionist.com/wp-content/uploads/2017/10/featured_front-desk-structure.jpg" + ")",
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        height: 600
      }}/>
          
  );
}

export default Banner;
